import React, { useState } from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import { autoPlay } from 'react-swipeable-views-utils';
import SwipeableViews from 'react-swipeable-views';
import Button from '@mui/material/Button';
import { Stack, Typography, useMediaQuery } from '@mui/material';
import { useTranslation } from 'react-i18next';
import prev from '../Media/Layer 2.png';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AutoPlaySwipeableViews = autoPlay(SwipeableViews);

export default function Blogs({ News }) {
  const matches = useMediaQuery('(min-width:1000px)');
  const [activeStep, setActiveStep] = useState(0);
  const maxSteps = Math.ceil(News.length / 3);
  const { t } = useTranslation();
  const navigate = useNavigate();

  const handleNext = () => {
    setActiveStep((prevActiveStep) => (prevActiveStep + 1) % maxSteps);
  };

  const handleBack = () => {
    setActiveStep((prevActiveStep) => (prevActiveStep - 1 + maxSteps) % maxSteps);
  };

  const handleStepChange = (step) => {
    setActiveStep(step);
  };

  const handleBlog = (id) => {
    console.log(id);
    axios.get(`${process.env.REACT_APP_API_URL}blog-details/${id}`).then((res) => {
      navigate('/blogDetails', { state: { data: res.data.data } });
    });
  };

  return (
    <div style={{ position: 'relative',justifyContent:'start',alignItems:'start' }}>
      <AutoPlaySwipeableViews
        index={activeStep}
        onChangeIndex={handleStepChange}
        interval={5000}
        style={{ overflow: 'hidden' }}
      >
        {News.map((c, index) => (
          <div key={index}>
            <Card sx={{ width: '300px', borderRadius: '10px' }}>
              <CardContent
                sx={{
                  padding: matches ? '30px' : '30px',
                  display: 'flex',
                  flexWrap: 'wrap',
                  justifyContent: 'start',
                  alignItems: 'start',
                  position: 'relative',
                }}
              >
                <Stack>
                  <img
                    src={c.image}
                    style={{
                      borderRadius: '10px',
                      width: '240px',
                      height: '200px',
                      objectFit: 'fill',
                    }}
                  />
                  <div
                    style={{
                      position: 'absolute',
                      bottom: '150px',
                      width: '230px',
                      left: matches ? '10%' : '10%',
                      height: '40px',
                      backgroundImage:
                        'linear-gradient(to top, rgba(0, 0, 0, 0.8), rgba(255, 255, 255, 0))',
                      padding: '5px',
                      borderRadius: '10px',
                    }}
                  ></div>
                  <Typography
                    sx={{
                      position: 'absolute',
                      bottom: '160px',
                      left: matches ? '13%' : '15%',
                      color: 'white',
                      fontWeight: 'bold',
                      fontSize: '16px',
                      padding: '5px',
                    }}
                  >
                    {c.title}
                  </Typography>
                  <Typography
                    sx={{
                      color: '#018EA2',
                      fontSize: '10px',
                      fontWeight: 'bold',
                      marginTop: c.date ? '10px' : '25px',
                    }}
                  >
                    {c.date}
                  </Typography>
                  <Typography
                    sx={{
                      color: '#7D4896',
                      fontSize: '14px',
                      marginTop: '10px',
                    }}
                  >
                    {c.description}
                  </Typography>
                  <Button
                    sx={{
                      bgcolor: '#7D4896',
                      color: 'white',
                      marginTop: '30px',
                      borderRadius: '5px',
                      '&:hover': {
                        bgcolor: '#7D4896',
                        color: 'white',
                      },
                      fontSize: '16px',
                      textTransform: 'none',
                    }}
                    onClick={() => {
                      handleBlog(c.id);
                    }}
                  >
                    {t('Read More')}
                  </Button>
                </Stack>
              </CardContent>
            </Card>
          </div>
        ))}
      </AutoPlaySwipeableViews>
      {maxSteps > 1 && (
  <>
    <Button
      onClick={handleBack}
      disabled={activeStep === 0}
      style={{ position: 'absolute', left: 0, top: '50%', transform: 'translateY(-50%)' }}
    >
      Back
    </Button>
    <Button
      sx={{
        color: '#7D4896',
        height: '30px',
        position: 'absolute',
        bottom: '220px',
        right: '50px',
        cursor: 'pointer'
      }}
      onClick={handleNext}
      disabled={activeStep === maxSteps - 1}
    >
      <img src={prev} style={{ width: '30px', height: '30px', transform: 'scaleX(-1)', cursor: 'pointer' }} alt="Next" />
    </Button>
  </>
)}
    </div>
  );
}
